"""
---------------------------------------------------------------------------------------------------------------------------------------------------------
Python Global Interpreter Lock (GIL), a mutex that protects Python objects, prevents threads within same process (multi-threading) to execute in parallel.
Ref: https://wiki.python.org/moin/GlobalInterpreterLock

Hence to take advantage of multi-core machines, use multiprocessing and run threads in parallel and spawn multiple OS processes.
---------------------------------------------------------------------------------------------------------------------------------------------------------
This program  does three tasks - 
#1. Create images.          #2. Move images to ./out folder.          #3.  Retain threashold in ./out folder and delete rest of files.

Pre-requisite: If you choose to use your jpg file: - 
    a. Uncomment line# 119, 120 
    b. Place a jpg (or any) image in the same folder this file is placed.
    c. replace the name in line#119 with yours and run the program (stanza "print_to_screen('image.jpeg')", "return").
    d. Copy the output from your console and replace line# 31 with yours.
    e. Comment line# 119, 120 and execute the program to see Parallelism in action
---------------------------------------------------------------------------------------------------------------------------------------------------------
"""

import os
import time
import base64
import datetime
from unicodedata import name
from multiprocessing import Process, current_process
from concurrent.futures import process



global_b64eString = b''
RETAIN_MAX_FILES = 5  #maximum files kept int the ./out folder

"""=========================================================================="""
"""Ignore my jpeg image by commenting line# 26, and you may feed your own jpg file name to below method and generate its base64encoded string """
def print_to_screen(imageName):
    with open(imageName, "rb") as imageasString:
        b64eStr = base64.b64encode(imageasString.read())
        print(b64eStr) 


"""=========================================================================="""
""""geneates jpg files with unique names"""
# async def generate_files():
def generate_files():
    pname = current_process()
    print(f'Starting {pname.name}...')
    
    for x in range(1):# giving more jobs
        outFileName = 'image_' + str(datetime.datetime.now())+'.jpg'

        with open(outFileName, "wb") as outFile:
            outFile.write(base64.b64decode(global_b64eString))
            outFile.close()
    print (f"Done {pname.name}...")


"""=========================================================================="""
"""move_files_to_storage rename a file at the folder level, keeps the source folder clean"""
# async def move_files_to_storage():
def move_files_to_storage():
    pname = current_process()
    print(f'Starting {pname.name}...')

    lstMoveFiles=[]
    try:
        if not os.path.exists("./out"):
            os.makedirs("./out")
    except IndexError:
        print ("Unable to create ./out directory.")
        return
    
    #append all files to a list
    for aFiles in os.listdir("./"):
        if aFiles.endswith(".jpg"):
            lstMoveFiles.append(aFiles)
            #print ("Added {} into list".format(aFiles))

    #read the list of files and move them
    try:
        for fileToMove in lstMoveFiles:
            #print ("File to move: " + fileToMove)
            outFileName = 'out/' + fileToMove
            os.rename (fileToMove, outFileName)
            #time.sleep(5) #keep it slow
    except IndexError:
        print ("No task. ", end = ' ')
    
    print (f"Done {pname.name}...")




"""=========================================================================="""
"""delete_files_upto_threashold deletes files and maintain threashold"""
#async def delete_files_upto_threashold():
def delete_files_upto_threashold():
    pname = current_process()
    print(f'Starting {pname.name}...')

    list_of_files = os.listdir('./out/')
    filesToDelete = len(list_of_files) - RETAIN_MAX_FILES
    if filesToDelete < RETAIN_MAX_FILES:
        print (name, " Done...")

    try:
        for file in list_of_files[:filesToDelete]:
            remove_fileName = './out/'+file
            print ("Deleting ", remove_fileName)
            print_to_screen (remove_fileName) ##printing so that the process will consume some cpu
            os.remove(remove_fileName)
            #time.sleep(1)##keep it slow
    except IndexError:
        print ("Error in parsing file list or an OS error")
    print (f"Done {pname.name}...")



def main():
    #print_to_screen('image.jpeg')
    #return

    STRESS_TEST_LIMIT=200
    for x in range(STRESS_TEST_LIMIT):
        serviceGenerateFiles = Process(name = 'File_Generator', target = generate_files)
        workerFileRenameFiles = Process(name = 'File_Renamer', target = move_files_to_storage)
        workerDeleteFiles = Process(name = 'Storage_Cleaner', target = delete_files_upto_threashold)
        serviceGenerateFiles.daemon = True

        workerDeleteFiles.start()
        workerFileRenameFiles.start()
        serviceGenerateFiles.start()  
        
        serviceGenerateFiles.join()
        workerFileRenameFiles.join()
        workerDeleteFiles.join()


if __name__ == "__main__":
    main()
    print ("Terminating main process.... ")
